remarks.format:
  
  
## Remarks  
 Projektanci mogą serializować siebie do kodu za pomocą aparatu, który przeszukuje wartości właściwości na żywo obiektów i generuje te wartości jako kod. Na przykład tekst przycisku jest generowany w następującym formacie.  
  
```csharp  
this.okButton.Text = "OK";  
```  
  
 Jednym z ograniczeń tego schematu jest trudne pobranie właściwości z innej lokalizacji. Na przykład trudno jest emitować kod w następującym formacie, ponieważ jedyną przyczyną, w której można polegać generator kodu, jest wartość we właściwości.  
  
```csharp  
this.titleLabel.Text = this.Text;  
```  
  
   
  
## Examples  
 <xref:System.ComponentModel.Design.Serialization.MemberRelationshipService> Upraszcza pobieranie wartości właściwości z innej lokalizacji. Projektant może uzyskać dostęp do tej usługi, aby wyrównać, że jeden element członkowski ma przypisaną wartość inną. Generator kodu wyszukuje takie relacje podczas generowania kodu, a jeśli relacja między dwoma elementami członkowskimi znajduje się w generatorze kodu, emituje kod dla relacji zamiast wyszukiwania wartości właściwości. Używając poprzedniego przypisania tekstu jako przykładu, Poniższy przykład kodu przedstawia kod czasu projektowania używany do ustanowienia relacji.  
  
```csharp  
object titleLabel, form;  
PropertyDescriptor titleLabelText = TypeDescriptor.GetProperties(titleLabel)["Text"];  
PropertyDescriptor formText = TypeDescriptor.GetProperties(form)["Text"];  
MemberRelationshipService ms = GetService(typeof(MemberRelationshipService);  
ms[titleLabel, titleLabelText] = new MemberRelationship(form, formText);  
```
